<script>

    function createNotification(message, type = 'alert-subtle-danger', duration = 3000) {
        // Создаем контейнер для уведомлений, если его еще нет
        let container = document.getElementById('notification-container');
        if (!container) {
            container = document.createElement('div');
            container.id = 'notification-container';
            // container.style.position = 'absolute';
            // container.style.right = '0';
            // container.style.bottom = '0';
            document.body.appendChild(container);
        }

        // Создаем само уведомление
        const alertDiv = document.createElement('div');
        alertDiv.className = `alert ${type} fade-in`;
        alertDiv.style.padding = '10px';
        alertDiv.style.margin = '0';
        alertDiv.textContent = message;

        // Добавляем уведомление в контейнер
        container.appendChild(alertDiv);

        // Удаляем уведомление после указанного времени
        setTimeout(() => {
            // Добавляем класс для запуска анимации исчезновения
            alertDiv.classList.add('fade-out');

            // Удаляем элемент после завершения анимации
            alertDiv.addEventListener('animationend', () => {
                alertDiv.remove();
            });
        }, duration);
    }

    function formatNumber(number, decimals, decimalSeparator, thousandSeparator) {
        // Ensure number is converted to a float and rounded to specified decimals
        number = parseFloat(number).toFixed(decimals);

        // Split the number into integer and fractional parts
        let parts = number.split('.');

        // Add thousand separators to the integer part
        parts[0] = parts[0].replace(/\B(?=(\d{3})+(?!\d))/g, thousandSeparator);

        // Join integer and fractional parts with the decimal separator
        return parts.join(decimalSeparator);
    }

    async function getSamarqand() {
        const controller = new AbortController();
        const timeoutId = setTimeout(() => controller.abort(), 60000); // Таймаут 60 секунд

        try {
            const response = await fetch('/site/samarqand', { signal: controller.signal });

            if (!response.ok) {
                throw new Error('Network response was not ok');
            }

            const text = await response.text(); // Получаем ответ как текст

            if (text === "false") {
                // Если ответ "false", создаем уведомление и повторяем запрос
                createNotification('Самарқанд вилояти билан алоқа узилган!', 'alert-subtle-danger', 3000);
                await new Promise(resolve => setTimeout(resolve, 5000)); // Ждем 5 секунд перед повторным запросом
                return getSamarqand(); // Рекурсивный вызов
            } else {
                const data = JSON.parse(text); // Парсим JSON строку
                console.log('Parsed data:', data);

                data.forEach(item => {
                    if (item.id === 1) {
                        const value = document.getElementById("active-power");
                        value.textContent = formatNumber(item.value, 2, ',', ' ').replace("-", "") + " МВт";
                        // activePower += item.value;
                    } else if (item.id === 2) {
                        const value = document.getElementById("true");
                        value.textContent = item.value;
                        // aggTrue += item.value;
                    } else if (item.id === 3) {
                        const value = document.getElementById("error");
                        value.textContent = item.value;
                        // aggError += item.value;
                    } else if (item.id === 4) {
                        const value = document.getElementById("false");
                        value.textContent = item.value;
                        // aggFalse += item.value;
                    }
                    // else if (item.id === 5) {
                    //     const value = document.getElementById("all");
                    //     value.textContent = item.value;
                    // }
                });

                console.log("Самарқанд вилояти");
            }
        } catch (error) {
            if (error.name === 'AbortError') {
                console.log('Запрос был отменен из-за таймаута');
                await new Promise(resolve => setTimeout(resolve, 5000)); // Ждем 5 секунд перед повторным запросом
                return getSamarqand(); // Рекурсивный вызов
            } else {
                console.error('Произошла ошибка:', error);
            }
        } finally {
            clearTimeout(timeoutId); // Очищаем таймаут
        }
    }

    document.addEventListener('DOMContentLoaded', function () {
        getSamarqand();
    });

